import React from 'react';
import './Navbar.scss';

const Navbar = () => {
  return (
    <Link to ="/">
      <div className='navbar'>
        <img className="logo-img" src="/images/cctracker-logo.png" alt=""></img>
        <span className="logo-txt">CCTracker</span>
      </div>
    </Link>
  )
}

export default Navbar;
